import withAuth from '../AuthChecker';
import { useNavigate } from 'react-router-dom';
import React from 'react';
import { Dialog, DialogTitle, DialogContent, DialogActions, Button, Typography, Box } from '@mui/material';
import { styled } from '@mui/material/styles';

interface Product {
  _id: string;
  BuyerName: string;
  SellerName: string;
  UnitPrice: number;
  TotalUnits: number;
  Tenure: number;
  RemainingUnits: number;
  ImageSeller: string;
  ImageBuyer: string;
  Xirr: number;
  ID: string;
}

interface OrderDetailsPopupProps {
  open: boolean;
  onClose: () => void;
  product: Product | null;
  units: number;
}

const StyledDialog = styled(Dialog)(({ theme }) => ({
  '& .MuiDialog-paper': {
    borderRadius: theme.spacing(2),
    backgroundColor: '#f5f5f5',
    padding: theme.spacing(2),
    width:"500px",

  },
}));

const StyledDialogTitle = styled(DialogTitle)(({ theme }) => ({
  backgroundColor: '#e0e0e0',
  textAlign: 'center',
  fontWeight: 'bold',
  borderRadius: `${theme.spacing(2)} ${theme.spacing(2)} 0 0`,
}));

const StyledDialogContent = styled(DialogContent)(({ theme }) => ({
  padding: theme.spacing(3),
}));

const StyledDialogActions = styled(DialogActions)(({ theme }) => ({
  justifyContent: 'center',
  padding: theme.spacing(2),
  backgroundColor: '#e0e0e0',
  borderRadius: `0 0 ${theme.spacing(2)} ${theme.spacing(2)}`,
}));

const OrderDetailsPopup: React.FC<OrderDetailsPopupProps> = ({ open, onClose, product, units }) => {
  const navigate = useNavigate();

  const handleClose = () => {
    onClose();
    navigate('/dashboard');
  };

  if (!product) return null;

  return (
    <StyledDialog open={open} onClose={handleClose}>
      <StyledDialogTitle>Order Details</StyledDialogTitle>
      <StyledDialogContent>
       
      </StyledDialogContent>
      <StyledDialogActions>
        <Button onClick={handleClose} variant="contained" >
          Close
        </Button>
      </StyledDialogActions>
    </StyledDialog>
  );
};

export default withAuth(OrderDetailsPopup);
